{"T0.help":"https://panoptes-uploads.zooniverse.org/tutorial_attached_image/fd25ac64-65a4-4014-bff8-e83b29f3c738.mp4

Hit the play button underneath the interface to watch the sequences of images all the way through to decide if you see a solar jet anywhere in the sequence. If you see a loop or a "rainbow" type structure - those are NOT jets - we are only interested in structures that shoot out away from the solar surface.

![good-classification small.PNG](https://panoptes-uploads.zooniverse.org/project_attached_image/e0c46c04-caf0-4464-b79b-1773a35f46cc.png)","T1.help":"This is to mark the time stamp for the beginning of the jet. If the jet seems like it starts before this video sequence begins, just mark the base of the jet in the first image in the sequence.","T2.help":"This is to mark the time stamp for the end of the jet. If the jet seems like it ends after this video sequence finishes, just mark the base of the jet in the last image in the sequence.","T3.help":"You can rotate the box tool to help enclose the full length of the jet in the smallest possible box.","T0.question":"Do you see a solar jet in the video clip?","T1.instruction":"Mark the position of the *base* of the jet in the frame containing the  *start* of each jet.","T2.instruction":"Mark the position of the *base* of the jet in the frame containing the  *end* of each jet.","T3.instruction":"On the frame with maximum jet length, draw a box from the base of the jet to the tip of the jet.","T1.tools.0.label":"Start.","T2.tools.0.label":"End.","T3.tools.0.label":"Jet extent tool.","T0.answers.0.label":"Yes.","T0.answers.1.label":"No."}

{"T0.help":"https://panoptes-uploads.zooniverse.org/tutorial_attached_image/fd25ac64-65a4-4014-bff8-e83b29f3c738.mp4

Hit the play button underneath the interface to watch the sequences of images all the way through to decide if you see a solar jet anywhere in the sequence. If you see a loop or a "rainbow" type structure - those are NOT jets - we are only interested in structures that shoot out away from the solar surface.

It doesn't matter if you see more than one jet in the sequence - the next workflow will account for that.","T0.question":"Do you see a solar jet in the video clip?","T0.answers.0.label":"Yes, there is at least one jet in this image sequence.","T0.answers.1.label":"No, there are no jets in this image sequence."}

